import styles from './ButtonMenu.module.scss'
import '../../../sours/icon/style.css'
import { useState } from 'react'

export default function ButtonMenu() {

    const [isHoverd, setHoverd] = useState(false)

    const hendlerMouseEnter = () => { setHoverd(!isHoverd) }
    const hendlerMouseOut = () => { setHoverd(!isHoverd) }

    let style = { background: '#e8e8e8' }
    style.background = isHoverd ? '#bdbdbd' : '#e8e8e8'
    return (
        <button
            className={styles['header-buttonMenu']}
            onMouseEnter={hendlerMouseEnter}
            onMouseOut={hendlerMouseOut}
            style={style}
        >
            <i className='ic_menu'></i>
        </button>
    )
}
